  BrowserRouter as Router,
  Route,
  Link,
  Switch
} from 'react-router-dom';


export default function App() {
  return (
    <Router>
      <div>
        <p>{logo}</p>
        <ul>
          <li>
            <Link to="/dop">DOP</Link>
          </li>
        </ul>

        <Switch>
          <Route component={DopComponent} path="/dop" />
        </Switch>
      </div>
    </Router>
  );
}
